// mainMenu.jsx
import React, { useEffect } from 'react';
import p5 from 'p5';
import { parallaxSketch } from './parallaxSketch';
import styles from './mainMenu.module.css';

function MainMenu() {
    useEffect(() => {
        const sketch = new p5(parallaxSketch);
        return () => sketch.remove();
    }, []);

    return (
        <div className={styles.mainMenuContainer}>
            {/* Canvas for parallax */}
            <div className={styles.parallaxCanvas}></div>

            {/* Header Section */}
            <header className={styles.header}>
                <h1 className={styles.logo}>Senp<span id="highlight">ai</span> Suggests</h1>
            </header>

            {/* Welcome Message Section */}
            <div className={styles.welcomeOverlay}>
                <h1 className={styles.welcomeText}>Welcome to Senp<span id="highlight">ai</span> Suggests!</h1>
            </div>

            {/* Navigation Links (based on template) */}
            <nav className={styles.nav}>
                <ul>
                    <li><a href="#watchlist">My Watchlist</a></li>
                    <li><a href="#wishlist">My Wishlist</a></li>
                    <li><a href="#lucky">I'm Feeling Lucky</a></li>
                </ul>
            </nav>
        </div>
    );
}

export default MainMenu;
